import {View, Text, StyleSheet} from 'react-native'

export default function Card(){
    return(
        <View style={styles.container}>
            <Text>Tela do card</Text>
        </View>
    )

}

const styles = StyleSheet.create({
    container:{
        flex: 1,
        alignItems: 'center',
        justifyContent: 'center',
    },
})
